import { Link, useLocation } from 'react-router-dom'
export default function PokemonDetails() {
  const location = useLocation()
  console.log(location)
  return (
    <div>
      <h1>Details.</h1>
      <button>
        <p>{location}</p>
        <Link to="/">Home</Link>
      </button>
    </div>
  )
}
